import Logo from './assets/img/logo.jpg';
import { Button } from 'bootstrap';

function App() {
  return (
    <div>
      <img src={Logo} className="App-logo" alt="logo" />
      <div>
        <Button color='primary'>Aqui</Button>
      </div>
    </div>
  );
}

export default App;
